import React from "react";

const MakePostForm = () => {
    return (
        <div>
            <form>
                <label>Title:</label>
                <input type='text'></input>
                <br></br>
                <label>Description:</label>
                <input type='text'></input>
                <br></br>
                <label>Price:</label>
                <input type='text'></input>
                <br></br>
                <input type='submit'></input>
            </form>
        </div>
    )
}

export default MakePostForm;
